import React from 'react'

const OperatorButton = (props) => {
    const char = props.operator.value
    return(
        <>
        <button className='operatorBtn' onClick={() => {props.changeData(char)}}>{props.operator.char}</button>
        </>
    )
}

export default OperatorButton;
